import React, {Component} from 'react';

class Sam1 extends Component {
    constructor() {
      super();
      this.state = {
        message: "Hai I am Siva"
      };
    }
    changeMsg = () => {
        this.setState({
            message:  "Welcome All"});
      }
    render() {
      return (
        <div>
          <h1> {this.state.message}</h1>
          <button type="button" onClick={this.changeMsg}>Click Me!</button>
        </div>
      );
    }
  }
export default Sam1;
